import { AppBar, Box, Toolbar, Typography, IconButton, Badge } from '@mui/material'
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import XIcon from '@mui/icons-material/X';
import WatchLaterIcon from '@mui/icons-material/WatchLater';
import EmailIcon from '@mui/icons-material/Email';
import './NavBar.css'
import { styled } from '@mui/material/styles';
import { makeStyles } from '@material-ui/core/styles';

const StyledToolbar = styled(Toolbar)(({ theme }: { index: any }) => ({
  alignItems: 'flex-start',
  paddingTop: theme.spacing(1),
  paddingBottom: theme.spacing(2),
  // Override media queries injected by theme.mixins.toolbar
  '@media all': {
    minHeight: 128,
  },
}));

function SocialMediaIcons() {
  return (
    <>
      <IconButton size="large" color="inherit">
        <Badge>
          <FacebookIcon />
        </Badge>
      </IconButton>
      <IconButton size="large" color="inherit">
        <Badge>
          <InstagramIcon />
        </Badge>
      </IconButton>
      <IconButton size="large" color="inherit">
        <Badge>
          <XIcon />
        </Badge>
      </IconButton>
    </>
  )
}

export default function NavBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{ bgcolor: "#689e31" }}>
        <Toolbar>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
          >
            <IconButton size="large" color="inherit">
              <Badge>
                <WatchLaterIcon />
              </Badge>
            </IconButton>
            Mon - Sat: 8am - 6pm
            <IconButton size="large" color="inherit">
              <Badge>
                <EmailIcon />
              </Badge>
            </IconButton>
            davidsgardeningservicesmedway@gmail.com
          </Typography>
          <SocialMediaIcons />
        </Toolbar>
      </AppBar>
    </Box >
  )
}
